    var diffInMonths = diffInTime / (1000 * 3600 * 24 * 30);
    if(diffInMonths < 12){
        count += 1;
    }
});
$.each(conCredEnqModel.getRows(),function(i,row){
    var enqDate = row.Enquiry_Date__c;
    var diffInTime = repDate.getTime() - enqDate.getTime();
    var diffInMonths = diffInTime / (1000 * 3600 * 24 * 30);
    if(diffInMonths < 12){
        count += 1;
    }
});
partyModel.updateRow(partyRow,'Number_of_Credit_Enquiries_in_Last_12_Mo__c', count);

